import Sidebar from './components/Menu/Sidebar'
import './App.css';

function App() {
  return (
    <div className="App">
      <Sidebar></Sidebar>
      <main style={{ marginTop: '64px' }}>
        <p>Main Page Content</p>
      </main>

    </div>
  );
}

export default App;
